//-----------------------------------------------------------------------------

Mallandro::Mallandro(char soundPin, char ledPin)
{
	soundPort = soundPin;
	ledPort = ledPin;
	playing = false;
	lastTime = 0;
	delayTime = 1700;
}

//-----------------------------------------------------------------------------

void Mallandro::Initialize(void)
{
	if (ledPort >= 0) {
		pinMode(ledPort, OUTPUT);
		digitalWrite(ledPort, LOW);
	}
}

//-----------------------------------------------------------------------------

void Mallandro::Play(bool playNow)
{
	if (playing) {
		if (millis() - lastTime >= delayTime) {
			playing = false;
			if (ledPort >= 0) {
				digitalWrite(ledPort, LOW);			
			}
		} 
		return;
	} else { 
		if (playNow == false) {
			return;
		}
	
		if (millis() - lastTime < delayTime) {
			return;
		} 		
	}
		
	playing = true;
	lastTime = millis();
	
	if (ledPort >= 0) {
		digitalWrite(ledPort, HIGH);			
	}
	startPlayback(__mallandro_sound_sampleXX, sizeof(__mallandro_sound_sampleXX));	
}

//-----------------------------------------------------------------------------

void Mallandro::Stop(void)
{
	stopPlayback();
	playing = false;
	lastTime = 0;
}

